import React, { useState } from "react";

function DogImage(props) {
    const { img, error } = props;  
    return (
        <div>
            {error && <p>Error: {error}</p>}
            <br />
            <br />
            {img && <img src={img} alt="Dog" width="500px"/>}
        </div>
    )
}

export default DogImage;
